The Telling is a 2000 science fiction novel by Ursula K. Le Guin set in her fictional universe of Hainish Cycle. The Telling is Le Guin's first follow-up novel set in the Hainish Cycle since her 1974 novel The Dispossessed. It tells the story of Sutty, a Terran sent to be an Ekumen observer, on the planet Aka, and her experiences political and religious conflicts between a corporatist government and the indigenous resistance, which is centered on the traditions of storytelling, locally referred to as &quot;the Telling&quot; (for which the book is named).
